import styled from "styled-components";

export const ColumnDiv = styled.div`
  display: flex;
  padding: 1em;
  flex-direction: column;
  width: 100%;
  box-sizing: border-box;
  color: #666666;
  font-size: 1em;
`;

export const CostCodeTitle = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  width: 100%;
`;
